export default {
  name: "ProvidentFund",
  props: ['CurrentAGE', 'RetireAGE', 'SavingAGE', 'ChargesRetireAmount', 'SavingBeginAmount', 'CompensationRate', 'SavingIncRate'],
  data: function data() {
    return {
      formstate: {},
      model: {
        CurrentAGE: 30,
        RetireAGE: 60,
        SavingAGE: 80,
        ChargesRetireAmount: 20000,
        SavingBeginAmount: 3.0,
        CompensationRate: 0.0,
        SavingIncRate: 0,
        SavingCurrent: 500000,
        IncomeRetire: 0,
        PVDRetire: 0,
        IncIncomeRetire: 0.5,
        CompensationRateRetire: 0,
        RMFSumRetire: 0,
        RMFSavingRateRetire: 0,
        RMFCompensationRateRetire: 0,
        SumYearRetire: 0,
        YearCompensationRateRetire: 0,
        OneTimeMoneyRetire: 0
      },
      result: {
        TotalChargesValue: 0,
        SavingMonth: 0,
        FvMonthlyGoals: 0
      }
    };
  },
  mount: function mount() {
    this.model.CurrentAGE = this.CurrentAGE;
    this.model.RetireAGE = this.RetireAGE;
    this.model.SavingAGE = this.SavingAGE;
    this.model.ChargesRetireAmount = this.ChargesRetireAmount;
    this.model.SavingBeginAmount = this.SavingBeginAmount;
    this.model.CompensationRate = this.CompensationRate;
    this.model.SavingIncRate = this.SavingIncRate;
  },
  method: {
    twoDigit: function twoDigit(val) {
      return val.toFixed(2).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
    },
    fieldClassName: function fieldClassName(field) {
      if (!field) {
        return "";
      }

      if ((field.$touched || field.$submitted) && field.$valid) {
        return "has-success";
      }

      if ((field.$touched || field.$submitted) && field.$invalid) {
        return "has-danger";
      }
    },
    onSubmit: function onSubmit() {
      var _this = this;

      if (this.formstate.$invalid) {
        // alert user and exit early
        return;
      }

      $('#result').fadeOut(200);

      if (this.formstate.$invalid) {
        return;
      }

      var response = callapi.post(Server + EndPoint, Retire, this.model, ocpkey).then(function (response) {
        _this.result.FutureValue = response.data.FutureValue;
        _this.result.SavingMonth = response.data.SavingMonth;
        _this.result.FvMonthlyGoals == response.data.FvMonthlyGoals;
        $('#result').fadeIn(400);
      }).catch(function (e) {
        _this.errors.push(e);
      });
    }
  },
  watch: {
    CurrentAGE: function CurrentAGE(newVal, oldVal) {
      this.model.RetireAGE = newVal;
    },
    RetireAGE: function RetireAGE(newVal, oldVal) {
      this.model.CurrentAGE = newVal;
    },
    SavingAGE: function SavingAGE(newVal, oldVal) {
      this.model.SavingAGE = newVal;
    },
    ChargesRetireAmount: function ChargesRetireAmount(newVal, oldVal) {
      this.model.ChargesRetireAmount = newVal;
    },
    SavingBeginAmount: function SavingBeginAmount(newVal, oldVal) {
      this.model.SavingBeginAmount = newVal;
    },
    CompensationRate: function CompensationRate(newVal, oldVal) {
      this.model.CompensationRate = newVal;
    },
    SavingIncRate: function SavingIncRate(newVal, oldVal) {
      this.model.SavingIncRate = newVal;
    }
  }
};
